import React from 'react'
import { Anchor } from 'antd';
const { Link } = Anchor
function Navbar() {
    return (
        <div>
            <div>
                <Anchor>
                    <Link href="#home" title="Home"/>
                    <Link href="#about" title="About"/>
                    <Link href="#contact" title="Home"/>
                </Anchor>
            </div>
        </div>
    )
}

export default Navbar;
